const script = () => {
    var myElement = document.getElementsByClassName("nav-toggle");
    var myElement1 = document.getElementById("nav-icon4");

    // Define the toggle function
    myElement[0].style.display = "none"
    function toggleDisplay() {
      if (myElement[0].style.display === "none") {
        myElement[0].style.display = "block";
      } else {
        myElement[0].style.display = "none";
      }
    }

    // Add a click event listener to the element
    myElement1.addEventListener("click", toggleDisplay);
  }

  export default script;
